import React, { Component } from "react";
import Background from '../../../src/images/DSCF7620_Vlai_Ly.jpg';

const sectionStyle = {
  width: "100%",
  height: "100vh",
  backgroundImage: `url(${Background})`
};

const SearchLanding = () => {
        return (
        <div>
            <div style={sectionStyle} className="landing-image">
                <div className="hero-content">
                    <h1 id="hero-title">Hmong Cultural Center's Library Catalog - Search</h1>
                </div>
            <form>
            <div className="container">
            <div className="row">
            <div className="col-md-6">
            <div className="form-group">
                <label htmlFor="searchQuery">Search</label>
                <input type="text" className="form-control" placeholder="Enter your search query"/>
            </div>
            </div>

            
            
            
            </div>
            <button type="submit" className="btn btn-info">Submit</button>
            </div>
            </form>

            </div>
        </div>
        )
}

export default SearchLanding;
